import React from "react";
import "./Card.css";

export default function Card({ card }) {
  return (
    <div className="card" key={card.id}>
      <img className="front" src={card.src} alt="card front" />
      <img className="back" src="/img/back.png" alt="card back" />
    </div>
  );
}
